import Layout from "../components/Layout";
import HobbyHub from "../Api/HobbyHub";


class Register extends React.Component {

  state = {email: '', password:''};

  onChange = (event) => {
    this.setState({
      email: event.target.value,
      password: event.target.value
    });
  }

  onSUbmit= (event)=> {
    event.preventDefault
  }

  render() {
    return (
      <Layout>
        <div>
        <form action="/user/signup" method="POST" className="form-signin">
        <div className="form-label-group">
          <input value={this.state.email} onChange={this.onChange} type="email" id="inputEmail" name="email" className="form-control" placeholder="Email" required autofocus />
        </div>
          <hr />
        <div className="form-label-group">
          <input value={this.state.password} onChange={this.onChange} type="password" id="inputPassword" name="password" className="form-control" placeholder="Password" required />
        </div>

        <div className="custom-control custom-checkbox mb-3">
          <input type="checkbox" className="custom-control-input" id="customCheck1" />
        </div>
        <button className="btn btn-lg btn-primary btn-block text-uppercase" type="submit">Sign Up!</button>

  </form>
        </div>
      </Layout>
    )
  }

}
 export default Register;
